import React from "react";
import UserPic from "../assets/userinfo.png";
import "./Userinfo.css";
function Userinfo()
{
    const Menu = ['Account','Logout'];
    return <div>
    <div className="user-icon">
         <img src={UserPic} alt="user" width={"70%"} height={"70%"} />
        </div> 
        <div className="">
            <ul>
                {
                    Menu.map
                }
            </ul>
            </div>  
    </div>;
}
export default Userinfo;
